import classes from './PortfolioItem.module.css';

function PortfolioItem(props) {
    return (
        <ul>
            <p className={classes.header}>Stock Name</p>
            <h3 className={classes.stock}>
                {props.name}
            </h3>


            <p>Amount</p>
            <h3 className={classes.amount}>
                {props.amount}
            </h3>
        </ul>
    )
}

export default PortfolioItem;
